import React from 'react';
import {render} from 'react-dom';
import {Link, Route, Router} from 'react-router';
import './App.css';

import CountDown from './componentes/CountDown.jsx';

const App = () => {
  return (
    <h2>{ Prueba } </h2>
  );
};

const Home = () => {
  return (
    <h2> {hola} </h2>
  );
};


render(
  <Router>
    <Route
      componen={Navegation}
      path="/"
    />

    <Route
      component={App}
      path="/app"
    />
  </Router>,
  document.getElementById('app')

);
